import React, { Component } from "react";
import { Link } from "@reach/router";
import Background from "./todoBG.jpg";
// import '../../src/FrontPage.css'
export default class FrontPage extends Component {
  render() {
    return (
      <div className="text-dark h-100 w-100">
        <img class="" src={Background} style={frontStyle} alt = 'background'/>
        <div class="card-img-overlay text-center">
          <h3 class="card-title">Here's your favorite Todo Website amirite?</h3>
          <p class="card-text">
            This is a wider card with supporting text below as a natural lead-in
            to additional content. This content is a little bit longer.
          </p>
          <Link className="btn btn-primary" to="/register">
            Register
          </Link>
          <Link className="btn btn-outline-primary" to="/login">
            Log in
          </Link>
        </div>
      </div>
    );
  }
}
const frontStyle = {
    position: 'absolute',
    height: '100%',
    width: '100%'
}
